const AllBooks = () => {
  const [data, setData] = useState('');

  useEffect(()=>{
    async function Res(){
        const result = await fetch('http://localhost:5555/books')
        const res = await result.json()
        setData(res.count)
    }

    Res();
  })
  return (
    <div>data.count</div>
  )
}

export default AllBooks
